import React, {Component} from 'react';
import {Writer} from './Writer';
import {Recommend} from './Recommend';
import {HomeList} from './HomeList';
import {Banner} from './Banner';

import {
	HomeContainer,
	LeftContainer,
	RightContainer
}from './style.js';

class Home extends Component{

	render() {
		return (
			<HomeContainer>
				<LeftContainer>
					<Banner />
					<HomeList />
				</LeftContainer>
				<RightContainer>
					<Recommend />
					
					<Writer />
					
				</RightContainer>
			</HomeContainer>
		)
	}
}

export default Home;
